import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the first product card
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child');

    // Wait for product detail modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_modal.png'));

    // Extract product details before adding to cart
    const productTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-detail-price', el => el.textContent.trim());

    // Add product to cart
    await page.click('.add-to-cart.large');

    // Wait for success notification
    await page.waitForSelector('.notification.success', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_added_to_cart.png'));

    // Verify cart count has updated
    const cartCount = await page.$eval('.cart', el => el.textContent.trim());
    const cartItems = cartCount.match(/\d+/);
    const itemCount = cartItems ? parseInt(cartItems[0]) : 0;

    return {
      success: true,
      action: "Added first product to cart successfully",
      extractedData: {
        productTitle,
        productPrice,
        cartCount: itemCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
